import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import AgeVar from "./components/ageVar/ageVar.js";
import "./components/ageVar/ageVar.css";

function App() {
  return (
    <div>
      <AgeVar />
      <Router>
        <div>
          <p>Hello Group Project</p>
        </div>
      </Router>
    </div>
  );
}

export default App;
